CREATE TABLE IF NOT EXISTS test_logs (
    -- Identifiant unique
    id SERIAL PRIMARY KEY ,
    run_id INTEGER NOT NULL,
    
    -- Informations test
    test_name VARCHAR(200) NOT NULL,          -- Ex: test_model_accuracy_threshold
    test_file VARCHAR(200) NOT NULL,          -- Ex: tests/unit/test_model_quality.py
    test_category VARCHAR(50) NOT NULL,       -- unit | integration | smoke
    test_gate INTEGER CHECK (test_gate IN (1, 2, 3)), -- Quel gate ?
    
    -- Résultats
    status VARCHAR(20) NOT NULL,              -- passed | failed | skipped | error
    duration_ms INTEGER,                      -- Temps d'exécution en ms
    error_message TEXT,                       -- Message d'erreur si échec
    error_traceback TEXT,                     -- Stack trace complète
    
    -- Métriques spécifiques (pour tests modèle)
    model_version VARCHAR(50),                -- Ex: v1.2.3
    model_accuracy DECIMAL(5,4),              -- Ex: 0.9420
    model_f1_score DECIMAL(5,4),              -- Ex: 0.8700
    api_latency_p99 INTEGER,                  -- Ex: 78 (ms)
    
    -- Contexte d'exécution
    git_commit_hash VARCHAR(40),              -- SHA du commit
    git_branch VARCHAR(100),                  -- Ex: main
    ci_run_id VARCHAR(100),                   -- GitHub Actions run ID
    environment VARCHAR(20),                  -- local | ci | staging
    
    -- Métadonnées
    created_at TIMESTAMP DEFAULT NOW(),
    created_by VARCHAR(100)                   -- Ex: github-actions | david.rambeau
);

-- Index pour requêtes fréquentes
CREATE INDEX idx_test_logs_status ON test_logs(status);
CREATE INDEX idx_test_logs_created_at ON test_logs(created_at DESC);
CREATE INDEX idx_test_logs_test_name ON test_logs(test_name);
CREATE INDEX idx_test_logs_gate ON test_logs(test_gate);
CREATE INDEX idx_test_logs_commit ON test_logs(git_commit_hash);



